import { Box } from "@mui/material"


export const BlogCard = ({ title, image_url }) => {
    const backgroundImageStyle = {
      backgroundImage: `url(${image_url})`,
      backgroundSize: "cover",
      backgroundPosition: "center",
      height: "100%",
      width: "100%",
    };

    return (
    <section className = "blog-card" id = "blog-card">
        <Box
        height={200}
        width={200}
        my={4}
        display="flex"
        alignItems="center"
        borderRadius="50px"
        gap={4}
        p={2}
        sx={{ border: '2px solid grey' }}
      >
        <div className="blog-card" style={backgroundImageStyle}>
          <div className="blog-txt">
          </div>
        </div>
      </Box>
      </section>
    );
  };
